import React from "react";
import stl from '../../styles/header.module.css'
import { Link } from "react-router-dom";


export default () => (
   
    <header className = {stl.header}>
       <nav>
          <Link to = '/' > MAIN </Link>
          <Link to = '/movies' > SEARCH </Link>
       </nav>
    </header>

)
